contracts/JobContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract JobContract {
    struct Job {
        string title;
        string description;
        uint256 budget;
        uint256 deadline;
        address client;
        bool isActive;
    }

    struct Proposal {
        address freelancer;
        string proposal;
        uint256 bidAmount;
        bool isAccepted;
    }

    mapping(uint256 => Job) public jobs;
    mapping(uint256 => Proposal[]) public proposals;
    uint256 public jobCount;

    event JobCreated(uint256 indexed jobId, address indexed client, string title, uint256 budget);
    event ProposalSubmitted(uint256 indexed jobId, address indexed freelancer, uint256 bidAmount);
    event ProposalAccepted(uint256 indexed jobId, address indexed freelancer);

    function createJob(
        string memory _title,
        string memory _description,
        uint256 _budget,
        uint256 _deadline
    ) external {
        require(_deadline > block.timestamp, "Deadline must be in the future");
        require(_budget > 0, "Budget must be greater than 0");

        jobCount++;
        jobs[jobCount] = Job({
            title: _title,
            description: _description,
            budget: _budget,
            deadline: _deadline,
            client: msg.sender,
            isActive: true
        });

        emit JobCreated(jobCount, msg.sender, _title, _budget);
    }

    function submitProposal(
        uint256 _jobId,
        string memory _proposal,
        uint256 _bidAmount
    ) external {
        require(_jobId > 0 && _jobId <= jobCount, "Invalid job ID");
        require(jobs[_jobId].isActive, "Job is not active");
        require(msg.sender != jobs[_jobId].client, "Client cannot submit proposal");
        require(_bidAmount > 0, "Bid amount must be greater than 0");

        proposals[_jobId].push(
            Proposal({
                freelancer: msg.sender,
                proposal: _proposal,
                bidAmount: _bidAmount,
                isAccepted: false
            })
        );

        emit ProposalSubmitted(_jobId, msg.sender, _bidAmount);
    }

    function acceptProposal(uint256 _jobId, address _freelancer) external {
        require(_jobId > 0 && _jobId <= jobCount, "Invalid job ID");
        require(msg.sender == jobs[_jobId].client, "Only client can accept proposal");
        require(jobs[_jobId].isActive, "Job is not active");

        Proposal[] storage jobProposals = proposals[_jobId];
        bool proposalFound = false;

        for (uint256 i = 0; i < jobProposals.length; i++) {
            if (jobProposals[i].freelancer == _freelancer) {
                jobProposals[i].isAccepted = true;
                proposalFound = true;
                break;
            }
        }

        require(proposalFound, "Proposal not found");
        jobs[_jobId].isActive = false;

        emit ProposalAccepted(_jobId, _freelancer);
    }

    function getJob(uint256 _jobId) external view returns (Job memory) {
        require(_jobId > 0 && _jobId <= jobCount, "Invalid job ID");
        return jobs[_jobId];
    }

    function getProposals(uint256 _jobId) external view returns (Proposal[] memory) {
        require(_jobId > 0 && _jobId <= jobCount, "Invalid job ID");
        return proposals[_jobId];
    }
}

contracts/UserProfile.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract UserProfile {
    struct Profile {
        string name;
        string bio;
        string skills;
        uint256 reviewCount;
        uint256 averageRating;
    }

    struct Review {
        address reviewer;
        uint256 rating;
        string comment;
        uint256 timestamp;
    }

    mapping(address => Profile) public profiles;
    mapping(address => Review[]) public reviews;

    event ProfileCreated(address indexed user, string name);
    event ReviewAdded(address indexed user, address indexed reviewer, uint256 rating);

    function createProfile(
        string memory _name,
        string memory _bio,
        string memory _skills
    ) external {
        require(bytes(_name).length > 0, "Name cannot be empty");
        require(bytes(_bio).length > 0, "Bio cannot be empty");
        require(bytes(_skills).length > 0, "Skills cannot be empty");
        require(profiles[msg.sender].reviewCount == 0, "Profile already exists");

        profiles[msg.sender] = Profile({
            name: _name,
            bio: _bio,
            skills: _skills,
            reviewCount: 0,
            averageRating: 0
        });

        emit ProfileCreated(msg.sender, _name);
    }

    function addReview(
        address _user,
        uint256 _rating,
        string memory _comment
    ) external {
        require(_user != msg.sender, "Cannot review yourself");
        require(_rating > 0 && _rating <= 5, "Rating must be between 1 and 5");
        require(bytes(_comment).length > 0, "Comment cannot be empty");
        require(profiles[_user].reviewCount > 0, "User profile does not exist");

        Profile storage profile = profiles[_user];
        reviews[_user].push(
            Review({
                reviewer: msg.sender,
                rating: _rating,
                comment: _comment,
                timestamp: block.timestamp
            })
        );

        // Update average rating
        profile.reviewCount++;
        profile.averageRating = ((profile.averageRating * (profile.reviewCount - 1)) + _rating) / profile.reviewCount;

        emit ReviewAdded(_user, msg.sender, _rating);
    }

    function getProfile(address _user) external view returns (Profile memory) {
        require(profiles[_user].reviewCount > 0, "Profile does not exist");
        return profiles[_user];
    }

    function getReviews(address _user) external view returns (Review[] memory) {
        require(profiles[_user].reviewCount > 0, "Profile does not exist");
        return reviews[_user];
    }
}

